  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The CMS Office of Minority Health has
  designed an interactive map, the Mapping Medicare Disparities Tool, to identify
  areas of disparities between subgroups of Medicare beneficiaries (e.g., racial and
  ethnic groups) in health outcomes, utilization, and spending. This information may
  be used to inform policy decisions and to target populations and geographies for
  potential interventions.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
